import React, {useState} from "react";

const Counter = () => {
  const [txtValue, setTxtValue] = useState("");

  const onChange = (e) => {
    setTxtValue(e.target.value);
  };

  return (
    <div>
      <input type="text" value={txtValue} onChange={onChange} />
      <br />
      <p>{txtValue}</p>    
    </div>
  )
}

export default Counter;
